import React from 'react';

export default function List(props) {
    console.log(props.list);
    const lista = props.list;
    if (lista !== undefined) {
        const listItems = lista.map((element) => {
            return (
            <ul className='doc'>
                <li style={{ color: 'red' }}> User: {element.user}</li>
                <li> Title: {element.title}</li>
                <li>Content: {element.content}</li>
            </ul>
            )
        }
        )
        return (
        <div>
            {listItems}
        </div>
        )
    } else {
        <div></div>
    }
}
